const Card = ({nombre, imagen, vida, ataque, defensa,velocidad, altura, peso}) => {

    
    return (
        <div className="carta">
        
            <h1> POKEMON </h1>
            <p>nombre: {nombre} </p>
            <p>imagen: {imagen} </p>
            <p>vida: {vida} </p>
            <p>ataque: {ataque} </p>
            <p>defensa: {defensa} </p>
            <p>velocidad: {velocidad} </p>
            <p>altura: {altura} </p>
            <p>peso: {peso} </p>
                    
        </div>
    )
}

export default Card;
